    "rachel-carson-national-wildlife-refuge-annual-narrative-report-calendar-year-1983",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Rachel
    Carson NWR outlines Refuge accomplishments during the 1983 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. Refuge administration is outlined; information about personnel, youth
    programs, funding, and safety is given. Habitat management is also covered; subjects
    include wetlands and forests. The wildlife section of the report discusses endangered
    and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, marine mammals, fisheries resources, and marking and bird banding.
    The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive programs, hunting, fishing, wildlife observation, outdoor recreation,
    and law enforcement. The equipment and facilities section of the report provides
    information about new construction, equipment replacement, communication systems,
    and energy conservation. Cooperative programs and items of interest are provided
    at the end. Field guides are attached.",nt"license_title": "License Not Specified",nt"extras":
